        I continue to grow weak. Desperate enough even to sip the Nuclear Cola. It didn't agree with me, but I tried. Should have drank up the alcohol faster and let myself succumb to alcohol poisoning - better fate. "Vault party" now a phrase that rings hollow.


        Note for those who come after me: Getting into vault = easy. Getting out of vault = hard.


        Note 2: Bring more welding fuel than I did. I don't get how these damned walls are so thick.


        Note 3: Why does the wiring always need repairs around here? Could have been seen on camera, rescued. What I'd give for a nice, comfy brig cell now.


        Also, someone please tell me what's in the gun safe. I'm dying to know. (Literally.) Most of the stuff out on the tables is crap.
