    - type: Paper
      content: >
        Remember that as the station's psychologist, your duties can include the writing of medicinal prescriptions - or if you have the correct medicines at hand, the filling of them.


        You might wish to review a basic chemistry text for a full list of possibilities, but here are some medicines you may wish to prescribe:


        [bold]For drowsiness or narcolepsy:[/bold]

        [bullet/][color=#d5d5e4]Ethyloxyephedrine[/color] 

        [italic]Minimum effective dose: 10u[/italic]

        [italic]Side effects: Jittering, stuttering[/italic]


        [bullet/][color=#b0abaa]Diphenylmethylamine[/color]

        [italic]Minimum effective dose: 5u[/italic]


        [bold]For insomnia or other sleeping problems:[/bold]

        [bullet/][color=#07E79E]Chloral Hydrate[/color]

        [italic]Maximum safe dose: 20u[/italic]

        [italic]Side effects: Slow movement[/italic]


        [bullet/][color=#128e80]Nocturine[/color]

        [italic][color=red]Controlled Substance[/color][/italic]

        [italic]Minimum effective dose: 8u[/italic]


        [bold]For suppressing hallucinations:[/bold]

        [bullet/][color=#b0abaa]Haloperidol[/color]

        [italic]Side effects: Drowsiness[/italic]


        [bold]General stimulants, for problems staying attentive:[/bold]

        [bullet/][color=#731024]Inaprovaline[/color]

        [italic]Weak stimulant safe for general-purpose use[/italic]


        [bullet/][color=#128e80]Ephedrine[/color]

        [italic]Maximum safe dose: 20u[/italic]

        [italic]Side effects: Jittering, overenergetic movements[/italic]


        [bullet/][color=#FAFAFA]Desoxyephedrine[/color]

        [italic]Maximum safe dose: 30u[/italic]

        [italic]Side effects: Jittering, stuttering, general twitchiness[/italic]


        [bold]To increase appetite:[/bold]

        [bullet/][color=#2690b5]Lipozine[/color]

        [italic]Recommended starting dose: 5u[/italic]


        [bold]To restore chemically damaged brains:[/bold]

        [bullet/][color=#A0A0A0]Mannitol[/color]

        [italic]Recommended starting dose: 5u[/italic]


        [bold]To suppress anxiety and mental distress:[/bold]

        [bullet/][color=#07E79E]Psicodine[/color]

        [italic]Maximum safe dose: 30u[/italic]


        [bold]Antidepressants:[/bold]

        [bullet/][color=#FF4DD2]Laughter[/color]

        [italic]Recommended starting dose: 5u[/italic]


        [bullet/][color=#EE35FF]Happiness[/color]

        [italic]Recommended starting dose: 5u[/italic]

        [italic]Side effects: Numbness, hallucinations, brain damage[/italic]

        [italic][color=red]Caution:[/color] This substance is known to have addictive properties[/italic]


        [bold]For racing, overwhelming, or uncontrollable thoughts:[/bold]

        [bullet/][color=#215263]Impedrezene[/color]

        [italic]Recommended starting dose: 1u[/italic]

        [italic]Side effects: Hallucinations, vomiting, drunkness[/italic]


        [bold]For overtalkativeness:[/bold]

        [bullet/][color=#000000]Mute Toxin[/color]

        [italic]Recommended starting dose: 5u[/italic]


        [bold]For handling anger management problems:[/bold]

        [bullet/][color=#AAAAAA]Pax[/color]

        [italic]Recommended starting dose: 5u[/italic]


        [bold]For patients who generally just need to chill out:[/bold]

        [bullet/][color=#808080]THC[/color]

        [italic]Recommended starting dose: 1 joint of minimum-to-moderate dankness[/italic]


        Remember to stamp your prescriptions with your official psychologist stamp of approval, and consider giving a copy to your client, faxing a copy to the chemistry department or to the CMO, and/or keeping a copy for your personal files.
